import React from "react"
import { HStack, Stack, Center, Heading, NativeBaseProvider } from "native-base"
export function Example() {
  return (
    <Stack space={3} alignItems="center">
      <HStack space={3} alignItems="center">
        <Center h="40" w="20" bg="primary.500" rounded="md" shadow={3} />
        <Center h="40" w="20" bg="secondary.500" rounded="md" shadow={3} />
        <Center h="40" w="20" bg="emerald.500" rounded="md" shadow={3} />
      </HStack>
    </Stack>
  )
}

export const HorizontalStack = () => {
  return (
    <NativeBaseProvider>
      <Center flex={1} px="3">
        <Example />
      </Center>
    </NativeBaseProvider>
  )
}
